import React from 'react';


import './App.css';
import {Route} from 'react-router-dom';
import Header from './components/Header/Header';
import Nav from './components/Nav/Nav';
import Profil from './components/Profil/Profil';
import Dialogs from './components/Dialogs/Dialogs';
import News from './components/News/News';
import Music from './components/Music/Music';
import Settings from './components/Settings/Settings';
import {ActionsTypes, StateType, StoreType} from "./Redux/State";

type PropsType = {
    _state: StateType
    dispatch: (action: ActionsTypes) => void
}

const App: React.FC<PropsType> = (props: PropsType) => {
    return (
        <div className='app-wrapper'>
            <Header/>
            <Nav/>
            <div className='app-wrapper-content'>
                <Route path='/profil' render={() => <Profil
                    profilPage={props._state.profilPage}
                    dispatch={props.dispatch.bind(props.dispatch)}/>}/>
                <Route path='/dialogs' render={() => <Dialogs state={props._state.dialogPage}/>}/>
                <Route path='/news' render={() => <News/>}/>
                <Route path='/music' render={() => <Music/>}/>
                <Route path='/settings' render={() => <Settings/>}/>
            </div>
        </div>
    );
}

export default App;
